package com.jsp.footmap.model;import java.util.Date;/** * Tokenç±» */public class Token {    private int tid;    private int uid;    private Date expired;    private int status;    private String tokens;    public int getTid() {        return tid;    }    public void setTid(int tid) {        this.tid = tid;    }    public int getUid() {        return uid;    }    public void setUid(int uid) {        this.uid = uid;    }    public Date getExpired() {        return expired;    }    public void setExpired(Date expired) {        this.expired = expired;    }    public int getStatus() {        return status;    }    public void setStatus(int status) {        this.status = status;    }    public String getTokens() {        return tokens;    }    public void setTokens(String tokens) {        this.tokens = tokens;    }}